import { useState } from "react";
import { Navbar, Footer, Login, Moria } from "./components";
import useToken from './services/useToken';
import { Routes, Route, BrowserRouter, Link } from "react-router-dom";

function setToken(userToken) {
  sessionStorage.setItem('accessToken', JSON.stringify(userToken));
}

function getToken() {
}

const App = () => {
  const { token, setToken } = useToken();

  if(!token) {
    return (
      <div className="bg-gradient-bg-welcome">
        <Navbar />
        <Login setToken={setToken} />
        <Footer />
      </div>
    )
  }
  if (token) {
    return (
      <div>

      </div>
    )
  }
  return (
    <div className="min-h-screen">
      <div className="bg-gradient-bg-welcome">
      <BrowserRouter>
        <Routes>
          <Route index element={<Navbar />} />
          <Route index element={<Login setToken={setToken} />} />
          <Route index element={<Footer />} />
          <Route index element={<Login token={token} />} />
        </Routes>
      </BrowserRouter>
      </div>
    </div>
  );
}

const Navigation = () => (
  <nav>
    <Link to="/"></Link>
    <Link to="/Moria">Moria</Link>
  </nav>
);

export default App;
